import React from "react";
import Button from "react-bootstrap/Button";
import bg from '../images/bg.png';
import bg1 from '../images/bg1.jpg';
import Typed from "react-typed";
// import { Button } from 'react-bootstrap';
import './style.css';
import { Link } from "react-router-dom";

const Register = () => {
    let st1 = {
        width: '45%',
        marginTop: '5%',
        marginLeft: '40%',
        padding: '0',
        fontSize: '150%',
      };

      return (
        <>
        <div className="container">
            <img src={bg} alt="background" id="background"/>
            <div className="inner">
                <img src={bg1} alt="" id="bg1"/>
                <p id="heading"><Typed strings={['Unable To FIND Objects??']} typeSpeed={100} backSpeed={20} startDelay={3000} loop={true} showCursor={false} /></p>
    
                <form className='signup' method='post'>
        <h5 className='loghead'>Sign Up </h5>
        <input type = "text" name="user" id = "user" placeholder='Enter the UserName'/>
        <br/>
        <input type = "password" name="pass" id ="pass" placeholder='Enter the Password'/>
        <br/>
        <input type = "text" name = "fname" id ="fname" placeholder="Enter your full name"/>
        <br/>
        <input type ="email" name="email" id="email" placeholder="Enter Your email"/>
        <Button type="submit" className="btn btn-default btn-sm" style={st1}>Sign up</Button>

        <Link to='/'><p id ="signbtn">Already have a account</p></Link> 

    </form>
               
            </div>
            
        </div>
        </>
      )
}

export default Register
